properties.property:
if(!this.lastStep[2]){
	this.stopCount++;
}

if(this.stopCount > 1){
	world.objects.getChild("PaintBrush").updateLocation(1502, 2618);
	this.state = "onleave";
	this.stopCount = 0;
	this.waypoint[0] = 4000;
	this.waypoint[1] = 4000;
}

this.animation = "hidden_down"; 
this.state = "onwait";
this.blockable = false;
this.stopCount = 0;
this.minimapColor = "#FF0";

player.stats.hasBrush = true;
var t = this.TriggerTask('cutscene', worldAdapter);
t.setTitle("");
t.addAnimation(worldAdapter.module.path + "/tasks/brush_obtain.png", 300);
t.addAnimation(worldAdapter.module.path + "/tasks/brush_obtain2.png", 300);
world.objects.removeChild(this.name);
if(performance && performance.now){
	recordEvent("Task", "Brush", "Pickup", Math.floor(performance.now()));
}else{
	recordEvent("Task", "Brush", "Pickup", 0);
}

if(player.stats && player.stats.kindness >= 3){
	player.stop();
	this.interactEnabled = false;
	worldAdapter.module.setBackgroundMusic(this.sound, this.fade);
	worldAdapter.showMessage("CLOUD_1", false, player, this, function(){
		let cloud = world.getObject("Cloud");
		let waypoint = cloud.waypoint;
		waypoint[0] = 1502;
		waypoint[1] = 2618;
		cloud.state = "ondropbrush";
	});
	world.triggers.removeChild("CloudTrigger");
}

this.interactEnabled = true;
this.fade = 100;
this.sound = new ArcSound("CloudMusic", true, modulePath + "/sound/That_Kid_in_Fourth_Grade_Who_Really_Liked_the_Denver_Broncos.mp3");
